window.bookSummaryJSON = "<p>Rule number one: Don't piss off the Sick Boys.</p> <p>They're cruel. Reckless. Impossibly f--ked up.</p> <p>The Sick Boys feed on the order they create. They rule Eastpoint University just as their families have for decades. But their power doesn't stop there. The three of them are heirs to some of the largest fortunes in the world, and behind that kind of wealth lies an underworld of corruption.</p> <p>On the surface, they're perfect princes and he is their king. But underneath it all, they're filled with blood, lies, and secrets. With all of their connections, they have the power to crush anyone who gets in their way. But just because they're as warped as I am doesn't mean I'm going to give them a free pass.</p> <p>Because I, Avalon Manning, bow to no one, and I live to break the f--king rules.</p> <p>Contains mature themes.</p>"; 
